import React from 'react';

interface BotProps {
    id: number;
    x: number;
    y: number;
};

const Bot: React.FC<BotProps> = ({ x, y }) => {
    const style = {
        position: 'fixed',
        left: `${x}px`,
        top: `${y}px`,
        width: '20px', 
        height: '20px',
        backgroundColor: 'red',
        borderRadius: '50%',
        transform: 'translate(-50%, -50%)',
    };

    return <div style={style} />
};

export default Bot;
